    document.addEventListener("DOMContentLoaded", function() {
        var allowedDomains = ['reidoscanais.com', 'reidoscanais.net', 'reidoscanais.org', 'www.reidoscanais.org', 'www.reidoscanais.net', 'www.reidoscanais.com'];
        var referrer = document.referrer;
        var isIframe = false;

        try {
            isIframe = window.self !== window.top;
        } catch (e) {
            isIframe = true;
        }

        var currentDomain = window.location.hostname;

        if (!isIframe) {
            window.location.href = "https://www.google.com";
        } else if (referrer) {
            var referrerDomain = new URL(referrer).hostname;
            if (!allowedDomains.includes(referrerDomain)) {
                window.location.href = "https://www.google.com";
            }
        } else if (!allowedDomains.includes(currentDomain)) {
            window.location.href = "https://www.google.com";
        }
    });
</script>
